					<li>选择“认证服务号”服务的站长请在“开发者中心”的 OAuth2.0 网页授权设置处设置授权回调页面域名为本网站域名</li>\n					\";s:14:\"wechatapi_tips\";s:364:\"\n					<li>插件开发人员在设计新的微信及 Discuz! 微社区类插件前请务必仔细阅读《<a href=\\\"http://open.discuz.net/?!devdoc\\\" target=\\\"_blank\\\">Discuz! 技术文库</a>》中的内容</li>\n					<li>开发技术交流，欢迎访问“<a href=\\\"http://open.discuz.net/?!bbs\\\" target=\\\"_blank\\\">Discuz! 开发者交流</a>”论坛</li>\n					\";s:8:\"wsq_tips\";s:711:\"\n					<li>完善以下资料后，您的微社区将自动开通，开通后用户可以在微信内阅读您的论坛内容，发帖也将同步到您的论坛</li>\n					<li>开通完成后，请将系统提供的微社区 URL 添加到微信自定义菜单或者设为关键词触发内容以便用户快速访问</li>\n					<li>如果您的微社区始终无法开通，请确认您的网站处于公网环境下，并将“<a href=\\\"http://addon.discuz.com/?@mobile.plugin\\\" target=\\\"_blank\\\">掌上论坛</a>”插件升级到最新版本</li>\n					<li>如果您的微社区无法正常发帖，请确认您的论坛当前版本已升级到最新 <a href=\\\"{ADMINSCRIPT}upgrade\\\">检查版本</a></li>\n					\";s:9:\"menu_tips\";s:502:\"\n					<li>使用此功能前请先确定您的公众号是否拥有“自定义菜单”服务，只有拥有此服务的公众号才可使用此功能</li>\n					<li>您可以设置最多 3 个菜单，每个菜单可以创建最多 7 个子菜单</li>\n					<li>如果您希望在菜单中添加微社区的访问功能，请在“菜单KEY值 / 网页链接”中填写“{url}”</li>\n					<li>菜单发布后，由于微信客户端缓存，需要24小时微信客户端才会展现出来</li>\n					\";s:13:\"response_tips\";s:524:\"\n					<li>此处可以设置微信公众号收到消息后的响应内容，默认由本插件自身控制，您可以自定义其中的内容</li>\n					<li>如果您的公众号没有“自定义菜单”服务，并且希望在收到信息后响应微社区的访问功能，请在“响应内容”中填写“LOGIN_WSQ”</li>\n					<li>我们允许其他插件接管此消息的控制权，请仔细阅读《<a href=\\\"http://open.discuz.net/?!devdoc\\\" target=\\\"_blank\\\">Discuz! 技术文库</a>》中的内容</li>\n					\";s:13:\"discuzqr_tips\";s:169:\"\n					<img src=\\\"source/plugin/wechat/image/discuz_qr.jpg\\\" align=\\\"left\\\" width=\\\"80\\\" /><br />扫描关注Discuz!官方微信<br /><br />获取官方最新动态\n					\";s:15:\"wsq_status_open\";s:9:\"已开通\";s:14:\"wsq_status_ing\";s:9:\"开通中\";s:14:\"wsq_status_try\";s:6:\"重试\";s:16:\"wsq_status_close\";s:9:\"未开通\";s:9:\"wsq_allow\";s:15:\"开启微社区\";s:17:\"wsq_allow_comment\";s:45:\"是否启用微社区的登录和访问功能\";s:20:\"wechat_allowregister\";s:30:\"是否启用微信用户注册\";s:28:\"wechat_allowregister_comment\";s:45:\"是否允许微信用户注册为本站会员\";s:24:\"wechat_allowfastregister\";s:18:\"启用快速注册\";s:32:\"wechat_allowfastregister_comment\";s:60:\"开启后未绑定的微信用户将直接注册为